import React, { useState } from "react";
import {
  Box,
  TextField,
  FormControl,
  InputLabel,
  Typography,
  Button,
} from "@mui/material";
import { styled } from "@mui/system";
import { useFormik } from "formik";
import { Link } from "@mui/material";
import { GoogleMap, LoadScript } from "@react-google-maps/api";

const Profile = () => {
  // const dispatch = useDispatch();
  // const navigate = useNavigate();
  // const [loading, setLoading] = useState(false);
  // const users = useSelector((state) => state.getuser?.getusers);

  const [name, setname] = useState("");
  const [username, setusername] = useState("");
  const [email, setEmail] = useState("");
  const [interest, setInterest] = useState("");
  const [location, setLocation] = useState("");
  const [billingInfo, setBillingInfo] = useState("");
  const StyledTypography = styled(Typography)({
    textTransform: "uppercase",
    textAlign: "center",
    marginBottom: 5,
  });

  const StyledButton = styled(Button)({
    width: "100%",
    marginTop: "1rem",
  });

  const { values, errors, touched, handleChange, handleSubmit, handleBlur } =
    useFormik({
      initialValues: {
        name: "",
        username: "",
        email: "",
        interest: "",
        location: "",
        billingInfo: "",
      },
      // validationSchema: crudopeUser,
      onSubmit: async (values) => {
        //     const [username, setusername] = useState("");
        // const [email, setEmail] = useState("");
        // const [password, setpassword] = useState("");
        // const [rePassword, setrePassword] = useState("");
        // const dispatch = useDispatch();
        //     e.preventDefault();
        //     if (password !== rePassword) {
        //       toast.error("Password does not match");
        //     } else {
        //       signup(dispatch, { username, email, password });
        //       setusername("");
        //       setEmail("");
        //       setpassword("");
        //       setrePassword("");
        //       redirect("/signup")
        //     }
      },
    });

  return (
    <Box
      sx={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        minHeight: "100vh",
        backgroundImage:
          "linear-gradient(to right, rgba(132, 250, 176, 0.5), rgba(143, 211, 244, 0.5))",
      }}
    >
      <Box
        sx={{
          width: "100%",
          maxWidth: 550,
          backgroundColor: "white",
          padding: "2rem",
          margin: ".5rem",
          borderRadius: "15px",
        }}
      >
        <Typography variant="h4" sx={{ marginBottom: "1.5rem" }}>
          Profile
        </Typography>
        <form
          onSubmit={handleSubmit}
          style={{ display: "flex", flexDirection: "column" }}
        >
          <Box
            sx={{ display: "flex", flexDirection: "row", marginBottom: "1rem" }}
          >
            <InputLabel
              htmlFor="name"
              sx={{
                marginRight: "1rem",
                minWidth: "120px",
                alignSelf: "center",
              }}
            >
              Name
            </InputLabel>
            <FormControl fullWidth>
              <TextField
                id="name"
                name="name"
                variant="outlined"
                value={values.name}
                onChange={handleChange}
                onBlur={handleBlur}
                error={errors.name && touched.name}
              />
            </FormControl>
          </Box>
          {/* Repeat the same structure for other fields */}
          <Box sx={{ textAlign: "center" }}>
            <Button type="submit" variant="contained" color="primary">
              Save
            </Button>
          </Box>
        </form>
      </Box>
    </Box>
  );
};

export default Profile;
